Penny Pax takes a break from studying, and gives her step cousin Jade Nile a call feeling homesick. Jade encourages Penny to come for a visit but will be the only one at the house for the weekend. The step cousin's enjoy a relaxing afternoon at Jade's painting one another's toe nails. Reminiscing about the past, the step cousins share their feelings on how much they appreciate one another and the love they share from being raised together at such a young age. Jade is interested to know more about the massage classes Penny is taking in school and would love for her to practice on her. Penny agrees that practicing on a family member would probably be more relaxing and less stressful. Watch Penny and Jade reunite as well as engage in an unforeseen lesbian affair!


